export default class NoteService {
    static async get_all_notes() {
        try {
            const response = await fetch('api/get_notes')
            // const response2 = await fetch('api/get_cat')
            let cat_id =await response.json()
            console.log(cat_id);
            return response.json()

        } catch (error) {
            console.log(error);
        }

    }
}
